package proto_ff;

import "yd_fieldoptions.proto";


message pointpoint
{
	optional int64 id = 1[(yd_fieldoptions.field_cname) = "路径ID"];
	optional int64 belongToSceneID = 2[(yd_fieldoptions.field_cname) = "所属场景"];
}


message Sheet_pointpoint
{
	repeated pointpoint pointpoint_List = 1[(yd_fieldoptions.field_arysize)=100];
}
